import Blog from './pages/blog/Blog';
import Contact from './pages/contact/Contact';
import Game from './pages/game/Game';

function Content(){
  return(
    <div className="content">
    <div className="container">
          <Switch>
            <Route exact path="/">
              <Home />
            </Route>
            <Route path="/proyectos">
              <Projects />
            </Route>
            <Route path="/radio">
              <Radio />
            </Route>
            <Route path="/blog">
              <Blog />
            </Route>
            <Route path="/contacto">
              <Contact />
            </Route>
            <Route path="/Â¿">
              <Game />
            </Route>
        </Switch>
    </div>
    </div>


  );
}



